import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Register from "./Register";  // Import Register component
import Login from "./Login";        // Import Login component
import Profile from "./Profile";    // Import Profile (protected route) component
import ProtectedRoute from "./ProtectedRoute";  // Import ProtectedRoute component

function App() {
    const [posts, setPosts] = useState([]);
    const [title, setTitle] = useState('');
    const [content, setContent] = useState('');
    const [editingId, setEditingId] = useState(null);

    useEffect(() => {
        fetchPosts();
    }, []);

    const fetchPosts = async () => {
        try {
            const response = await axios.get('http://localhost:5000/api/posts');
            setPosts(response.data);
        } catch (error) {
            toast.error("Failed to load posts");
        }
    };

    const createPost = async () => {
        if (!title.trim() || !content.trim()) {
            toast.success("Title and Content cannot be empty!");
            return;
        }

        try {
            await axios.post("http://localhost:5000/api/posts", { title, content });
            setTitle("");
            setContent("");
            fetchPosts();
        } catch (error) {
            toast.error("Error creating post:", error);
        }
    };

    const deletePost = async (id) => {
        try {
            await axios.delete(`http://localhost:5000/api/posts/${id}`);
            toast.success("Post deleted!");
            fetchPosts();
        } catch (error) {
            toast.error("Failed to delete post");
        }
    };

    const updatePost = async () => {
        try {
            await axios.put(`http://localhost:5000/api/posts/${editingId}`, { title, content });
            toast.success("Post updated successfully!");
            setTitle('');
            setContent('');
            setEditingId(null);
            fetchPosts();
        } catch (error) {
            toast.error("Error updating post");
        }
    };

    return (
        <Router>
            <div className="container">
                <h1>Community Sync</h1>

                {/* Input Form */}
                <div className="input-container">
                    <input type="text" value={title} onChange={(e) => setTitle(e.target.value)} placeholder="Title" />
                    <textarea value={content} onChange={(e) => setContent(e.target.value)} placeholder="Content"></textarea>
                </div>
                {editingId ? (
                    <button className="edit-btn" onClick={updatePost}>Update Post</button>
                ) : (
                    <button className="post-btn" onClick={createPost}>Post</button>
                )}

                {/* Posts List */}
                {posts.length > 0 ? (
                    posts.map((post) => (
                        <div key={post._id} className="post-container">
                            <h3>{post.title}</h3>
                            <p>{post.content}</p>

                            {/* Button Group for Spacing */}
                            <div className="button-group">
                                <button className="edit-btn" onClick={() => {
                                    setEditingId(post._id);
                                    setTitle(post.title);
                                    setContent(post.content);
                                }}>Edit</button>

                                <button className="delete-btn" onClick={() => deletePost(post._id)}>Delete</button>
                            </div>
                        </div>
                    ))
                ) : (
                    <p>No posts available. Start adding some!</p>
                )}

                {/* Notification Container */}
                <ToastContainer position="top-center" autoClose={3000} />

                {/* Authentication Routes */}
                <Routes>
                    <Route path="/register" element={<Register />} />
                    <Route path="/login" element={<Login />} />

                    {/* Protected Route for Profile */}
                    <Route path="/profile" element={
                        <ProtectedRoute>
                            <Profile />
                        </ProtectedRoute>
                    } />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
